import React, { useState } from 'react'
import Loading from './loading';
// import '.'; // Adjust the path as necessary
export default function Tours({tours}) {
   
   
    
    

  return (
        <>
            <h1 className='font-mono text-[30px] underline  text-center' >Our Tours</h1>
            <div className='flex h-[100vh] justify-center items-center'>
            <div className='border-2 border-black   flex text-center flex-col p-5'>
                {
                    tours.map((data,index)=>
                    {
                        return(
                            <>
                            <img src={data.image} className='h-80'></img>
                            <div className='font-mono'>{data.name}</div>
                            </>

                        )
                    })
                }

          

            </div>
            
            </div>
        </>
  )
}


